import React, { useEffect } from "react";

fetch('http://example.com/movies.json')
  .then(response => response.json())
  .then(data => console.log(data));

function gettables() {
    const data = fetch('http://127.0.0.1:3000/tables')
    return (
        <>
        {data}
        </>
    )
}

export default gettables
